  $水果千層：水果新鮮，帶著濃郁豐富的香氣，奶油與草莓，香蕉，奇異果，藍莓，沒有過多的酸氣，奶油圓潤不膩∼
@草莓便當：長崎蛋糕鋪底，中間是新鮮草莓打成草莓醬做的慕絲，上層則是新鮮的草莓，草莓香濃卻沒有過多的草莓酸...
@北海道海鹽奶蓋伯爵紅/奶茶：奶泡紮實，奶香濃郁，茶香目明，甜而不膩，舒服呀∼
態度及環境都很舒服的一家店，推推...

